async function ExpenseItem(){
    const expensedate =new Date().getDate
    let x=await prompt("which car do you have?")
    return (
    <div className='expense-item'>
        <div>Date</div>
        <div className='expense-item__description'>
            <h2>{x}</h2>
            <div className='expense-item__price'>$249.5</div>
        </div>
        </div>
        );
}
export default ExpenseItem;
